import Navbar from "../components/Navbar";
import Login from "../components/Login";
import { useState } from "react";
function Home() {
    const [login,setlogin]=useState (false)
  return (
    
   <div>
      <Navbar setlogin={setlogin} login={login}/>
      <Login login={login}/>
   </div>
  )
}

export default Home;
